import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export default class TopComponent extends React.Component {
    constructor(props){
        this.state = {
            gamestate: null
        }
    }

    render(){
        return <div>
              <Router>
            <Switch>
          <Route path="/create">
            <Create />
          </Route>
          <Route path="/join">
            <Join />
          </Route>
          <Route path="/lobby">
            <Lobby />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
  </Router>
        </div>
    }

    Home() {
        return <div>
                  <h2>Home</h2>
                    <div className="button-list-landing-page">
                      <Link to="/create" className="main-btn">Create Game</Link>
                      <Link to="/join" className="main-btn">Join Game</Link>
                    </div>
              </div>;
      }



    Create() {

        return <div>
                  <h2>Create a game</h2>
                  <Link to="/" className="main-btn">Main page</Link>
                  <div className="create-game-form">

                  </div>
                  <CreateGame onGameCreatedCallback={onGameCreatedCallback} setGamestate={setGamestate}></CreateGame>
              </div>;
      }

    Join() {
        return  <div>
                    <h2>Join a game</h2>
                    <Link to="/" className="main-btn">Main page</Link>
                    <JoinGame></JoinGame>
                </div>;
      }

    Lobby(){
        return <div>
            <GameLobby username="Tobias"></GameLobby>
          </div>

      }
}
